class Node():
	def __init__(self,word,level,prev):
		self.word1 = word
		self.level = level
		self.prev = prev
class Solution(object):
	def findLadders(self, beginWord, endWord, wordDict):
		"""
		:type beginWord: str
		:type endWord: str
		:type wordDict: Set[str]
		:rtype: int
		"""

		wordDict = list(wordDict)
		wordDict.append(beginWord)
		wordDict.append(endWord)
		if len(wordDict) == 0:
			return False
		l = len(wordDict[0])
		d = {}
		unvisited = {}
		stack = [Node(beginWord,1,None)]
		for word in wordDict:
			unvisited[word] = True
		visited = {}
		ret = []
		minlevel = None
		prevlvl = 0
		while (len(stack)):
			wordnode = stack.pop(0)
			level= wordnode.level
			if prevlvl < level:
				for key in visited:
					if key in unvisited:
						del unvisited[key]
			prevlvl = level
			for x in xrange(l):
				for c in xrange(26):
					c = chr(97+c)
					word2 = wordnode.word1[:x]+c+wordnode.word1[x+1:]
					if word2 in unvisited and word2 != wordnode.word1:
						if minlevel != None:
							if level+1 > minlevel:
								continue
						if word2 == endWord :
							if minlevel == None:
								minlevel = level +1
							r = [word2]
							p = wordnode
							while p != None:
								r.append(p.word1)
								if p.word1 in visited:
									del visited[p.word1]
								p = p.prev
							ret.append(r[::-1])
						else:
							stack.append(Node(word2,level+1,wordnode))
							# visited[word2] = True
		return ret
